import './App.css';
import "./components/buisnessCard"
import BuissnessCard from './components/buisnessCard';
import DropDown from './components/dropdown';
import {useState} from "react";

function App() {

  const [turnPhone, setTurnPhone] = useState("");
  const [hidePhone, setHidePhone] = useState(true);

  return (
    <div className="App">
      <BuissnessCard 
        turnPhone={turnPhone}
        setTurnPhone={setTurnPhone}
        hidePhone={hidePhone}
        setHidePhone={setHidePhone} />

      <DropDown turnPhone={turnPhone}
      hidePhone={hidePhone} />
    </div>
  );
}

export default App;
